import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import Users from './page/Users/Users';


function App() {
  return (
    <div className="App">

      <Router>
        <Routes>
          <Route exact path="/" element={<Users />} />

        </Routes>
      </Router>
    </div>
  );
}

export default App;
